import React from 'react';

interface DataTableProps {
    data: any[];
    searchField: string;
    targetValue: string;
}

const DataTable: React.FC<DataTableProps> = ({ data }) => {
    return (
        <table className="table">
            <thead>
                <tr>
                    <th>Name</th>
                    <th>Email & Company</th>
                    <th>Phone</th>
                </tr>
            </thead>
            <tbody>
                {data.map((item, index) => (
                    <tr key={index}>
                        <td>{item.name}</td>
                        <td>{item.displayEmailAndCompany}</td>
                        <td>{item.phone}</td>
                    </tr>
                ))}
            </tbody>
        </table>
    );
};

export default DataTable;
